css:
@namespace url(http://www.w3.org/1999/xhtml);



@-moz-document url-prefix('http://www.tumblr.com/'), url-prefix('https://www.tumblr.com/')   {





ol#posts li.post.new_post {

background: #ffffff url('http://img256.imageshack.us/img256/2606/tumblrladmgmecao1qdmm2z.png') bottom right no-repeat;

}



img[src*="http://assets.tumblr.com/images/new_post_icons_no_labels.png"]{

    width:0;

    height:70px;

    padding-right:250px;

    opacity: 0;

}

#posts .post .arrow {
height: 0px;
left: -7px;
position: absolute;
top: 25px;
width: 8px;
}


}
